import React from 'react';
import { Form, FormGroup } from 'reactstrap';


const AddCourse = () => {

    return (
        <Fragments>
            <Form>
                <FormGroup>
                    <label for="userId">Course Id</label>
                    <Input type="text" placeholder="Enter here" name="userId" id="userId"></Input>
                </FormGroup>
            </Form>
        </Fragments>
    )
}

export default AddCourse;
